import React from "react";

export default function section() {
  return (
    <section className="most-picked">
      <div className="container mx-auto">
        <div className="text-blue_dark font-sans font-medium text-2xl mt-16 mb-5">
          <h1>Most Picked</h1>
        </div>
        <div className="grid grid-flow-col lg:grid-cols-12 lg:grid-rows-2 grid-flow-row">
          <div className="items col lg:col-span-4 relative"></div>
          <div className="items col lg:col-span-4 relative"></div>
          <div className="items col lg:col-span-4 relative"></div>
          <div className="items col lg:col-span-4 relative"></div>
          <div className="items col lg:col-span-4 relative"></div>
          <div className="items col lg:col-span-4 relative"></div>
        </div>
      </div>
    </section>
  );
}
